import React from "react";
import PostForm from "../components/PostForm";
import PostCard from "../components/PostCard";

// 2-7
const Home = () => {
  return (
 
      <div>
       {dummy.isLoggedIn && <PostForm></PostForm> }
        
          
            {dummy.mainPosts.map(c => {
              return (
                <PostCard></PostCard>
              );
            })}
      </div>

  );
};
export default Home;
